export default function Nav(){
    return(
        <nav>
               <ul>
                <li><a href="#home">Home</a></li>
                <li><a href="#about">About</a></li>
                <li><a href="#reservation">Reservation</a></li>
                <li><a href="#orderonline">OrderOnline</a></li>
                <li><a href="#login">LogIn</a></li>
               </ul>
        </nav>
       
    )

}
